Dirty Business: &lt;#&gt;&lt;#&gt;&lt;#&gt;&lt;#&gt;Follow an eclectic crew from a leading landscape design firm that create breath taking outdoor spaces&lt;#&gt;&lt;#&gt;&lt;#&gt;&lt;#&gt;

Virgin Territory

New house, new neighbourhood and the homeowners want it to stand out far from the bland crowd. Dirty Business host James Dale takes the lead, transforming the backyard into a pleasure zone complete with a plunge pool, an outdoor fireplace and plenty of patio space for entertaining. Trick is to keep it real budget-wise
